componentsModule.modules.planner={start:function(){let current=componentsModule.modules.planner;current.parentElement=document.querySelector("[data-component=planner");current.customPublish=current.parentElement.querySelector(".component_planner_publish_custom");current.notifyBox=current.parentElement.querySelector(".component_planner_notify_email");current.publishAuto=current.parentElement.querySelector("[name=component_planner_publish]");current.publishInput=current.parentElement.querySelector("[name=component_planner_publish_datetime]");current.expiryInput=current.parentElement.querySelector("[name=component_planner_publish_expiry]");current.plannerNotify=current.parentElement.querySelector("[name=component_planner_notify]");current.notifyEmail=current.parentElement.querySelector("[name=component_planner_notify_email]");componentsModule.initializeEvents([{event:"change",element:current.parentElement,content:function(a){let target=a.target;if(target===current.publishAuto){if(target.checked){current.customPublish.classList.add("hide")}else{current.customPublish.classList.remove("hide")}reloadPackery()}else{if(target===current.plannerNotify){if(target.checked){current.notifyBox.classList.remove("hide")}else{current.notifyBox.classList.add("hide")}reloadPackery()}}}},{event:"click",element:current.parentElement,content:function(a){if(a.target.matches(".clear-input")){a.target.parentNode.querySelector("input").value=""}}}])},resume:function(){let current=componentsModule.modules.planner;const a=current.parentElement.getAttribute("data-resume");if(a===""){return true}const b=JSON.parse(a);if(b===null){return true}current.publishAuto.checked=!(b.planner);triggerEvent(current.publishAuto,"change");current.publishInput.value=b.planner_date;current.expiryInput.value=b.planner_expiry;current.plannerNotify.checked=!!(b.planner_notify);triggerEvent(current.plannerNotify,"change");current.notifyEmail.checked=!!(b.planner_notify_email)},validate:function(){return true},serialize:function(){let current=componentsModule.modules.planner;return{planner:!(current.publishAuto.checked),planner_date:current.publishInput.value.trim(),planner_expiry:current.expiryInput.value.trim(),planner_notify:!!(current.plannerNotify.checked),planner_notify_email:!!(current.notifyEmail.checked)}}};